import Vue from 'vue';
import VueRouter from 'vue-router';
import LandingPage from 'src/main/resources/static/LandingPage.vue';

Vue.use(VueRouter);

const router = new VueRouter({
    mode: 'history',
    routes: [
        {
            path: '/landing',
            name: 'Home',
            component: LandingPage
        },
        // Andra v채gar h채r...
    ]
});

export default router;
